script: |
  super -f text -I q1650.spq | sort > q1650.out

inputs:
  - name: q1650.spq
    data: |
      SELECT DISTINCT + + cor0.col1 * ( + ( - col0 ) ) - + 8 * 86 AS col2 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q1650.out
    data: |
      -1328
      -1728
      -766
